(def n 32)

(def r
  (nth (map :genotype (sort-by :complexity (:elite result))) n))

(tree/count-nodes r)

(def rr 
  (grammar-replace r))

(tree/count-nodes rr)

(lagrangian/lagrange-score-mmd-print
  (lagrangian/prepare-lagrange-mmd-data dat t-step '[theta])
  t-step '[theta] '[omega] rr)

(render/mathematician-view rr)

(mma/fullform rr)

